import axios from 'axios';

import {Pagination, Nav, Col, Container, Navbar, Row, ListGroup} from 'react-bootstrap'
import { useState, useCallback, useEffect } from 'react';

function App() {
  const [rates, setRates] = useState([])
  const [currentRates, setCurrentRates] = useState([])
  const [page, setPage] = useState(1)
  const ratesPerPage = 15
  const fetchAndGetRates = "http://localhost:8080/rates?usedb=true";
  const getRates = "http://localhost:8080/rates?usedb=false";
  const deleteAllRates = "http://localhost:8080/deleteAll";
  let items = []
  const indexOfLastPage = (page) * ratesPerPage
  const indexOfFirstPage = indexOfLastPage - ratesPerPage

  console.log(setCurrentRates(rates.slice(indexOfFirstPage, indexOfLastPage)))
  for (let number = 1; number <= Math.ceil(rates.length / ratesPerPage); number++) {
    items.push(
      <Pagination.Item key={number} active={number === page}
        onClick={() => {
          setPage(number) 
        }}
      >
        {number}
      </Pagination.Item>,
    );
  }

  const processFetchAndGetRates = async(e) => {
    e.preventDefault();
    try {
      const resp = await axios({
        method: 'get',
        withCredentials: false,
        url: fetchAndGetRates,
        headers: {
          "Access-Control-Allow-Origin": "*"
        },
      });
      console.log(resp.data)
      setRates(resp.data)
    } catch (error) {
      console.log(error)
    }
  }

  const processGetRates = async(e) => {
    if (e !== undefined)
      e.preventDefault();
    try {
      const resp = await axios({
        method: 'get',
        withCredentials: false,
        url: getRates,
        headers: {
          "Access-Control-Allow-Origin": "*"
        },
      });
      console.log(resp.data)
      setRates(resp.data)
    } catch (error) {
      console.log(error)
    }
  }

  const processDeleteAll = async(e) => {
    if (e !== undefined)
      e.preventDefault();
    try {
      await axios({
        method: 'delete',
        withCredentials: false,
        url: deleteAllRates,
        headers: {
          "Access-Control-Allow-Origin": "*"
        },
      });
    } catch (error) {
      console.log(error)
    }
  }

  useEffect((e) => {
    processGetRates(e);    //  get list of rates after downloading
    setCurrentRates(rates.slice(indexOfFirstPage, indexOfLastPage))
  }, [page]);

  return (
    <>
      <Navbar bg='dark'>
        <Container>
          <Navbar.Brand>
            <div style={{color: "white"}}>Exchange Rates</div>
          </Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link onClick={processFetchAndGetRates}>
              <div style={{color: "white"}}>Fetch and Get</div>
            </Nav.Link>
            <Nav.Link onClick={processGetRates}>
              <div style={{color: "white"}}>Get</div>
            </Nav.Link>
            <Nav.Link onClick={processDeleteAll}>
              <div style={{color: "white"}}>Clear</div>
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <Row style={{height: "90vh"}}>
        <Col style={{height: "90vh"}}>
          <ListGroup>
            {currentRates.map(rate => {
              return <ListGroup.Item onClick={(e) => console.log(rate.id)} key={rate.id} as="li">
                <Row>
                  <Col>
                    Label: {rate.shortName}
                  </Col>
                  <Col>
                    Buy: {rate.valBuy}
                  </Col>
                  <Col>
                    Sell: {rate.valSell}
                  </Col>
                </Row>
              </ListGroup.Item>
            })}
          </ListGroup>
          <Container>
            <Pagination>{items}</Pagination>
          </Container>
        </Col>

        <Col>
          <Container>

          </Container>
        </Col>
      </Row>
    </>
  );
}

export default App;
